import React from "react";
import logo from '../logo.svg';

function NavHeader() {
    return (
        <div class="header-bg">
            <section>
                <img src={logo} /><p>Edit <code>src/App.js</code> and save to reload.</p>
            </section>
        </div>
    )
}

export default NavHeader;
